pragma solidity >=0.8.0;
pragma abicoder v2;

contract CompiledRockPaperScissors  {
  struct Opening {
    uint8 rps1;
    uint256 nonce;
  } 
  address payable[] private players;
  uint8 public winner;
  uint256 public commitment;
  uint8 public rps2;
  function open(Opening memory decommitment)  public {
    require(((state == uint32(0x902c83b9)) && ((players[uint256(0)] == address(0)) || (players[uint256(0)] == payable(msg.sender)))), "access control or flow guard failed");
    require((commitment == uint256(keccak256(abi.encode(Opening(decommitment.rps1, decommitment.nonce))))), "Wrong opening");
    (winner) = (((decommitment.rps1 % uint8(3)) == (rps2 % uint8(3))) ? uint8(3) : (((decommitment.rps1 % uint8(3)) == ((rps2 + uint8(1)) % uint8(3))) ? uint8(1) : uint8(2)));
    (state) = 0;
  } 
  function move(uint8 tmp)  public {
    require(((state == uint32(0x3c1d1878)) && ((players[uint256(1)] == address(0)) || (players[uint256(1)] == payable(msg.sender)))), "access control or flow guard failed");
    (rps2) = tmp;
    (state) = uint32(0x902c83b9);
  } 
  function commit(uint256 tmp)  public {
    require(((state == uint32(0xacc83c6b)) && ((players[uint256(0)] == address(0)) || (players[uint256(0)] == payable(msg.sender)))), "access control or flow guard failed");
    (commitment) = tmp;
    (state) = uint32(0x3c1d1878);
  } 
  constructor(address payable[] memory players$) {
    players = players$;
    winner = uint8(0);
    commitment = uint256(0);
    rps2 = uint8(0);
    (state) = uint32(0xacc83c6b);
    uint8(0);

  } 
  function get_players()  public view returns (address payable[] memory result) {
    address payable[] memory tmp = players;
    return(tmp);
  } 

  uint32 public state;
  // bytes public reqArgs;
  // bytes public store;
  // struct Closure { uint32 id; bytes data; }
