  function mk(Closure memory response) private {
    // reqArgs = response.data;
    // store = hex"";
    state = 0;
  }*/
  /*
  function flatMap(Closure memory request, Closure memory callback) private {
    // reqArgs = request.data;
    // store = callback.data;
    state = callback.id;
  }*/

}
